import { h } from 'preact';
import { classNames } from '../styles';

interface FloatingActionButtonProps {
  isVisible: boolean;
  isModelLoading: boolean;
  isReady: boolean;
  onClick: () => void;
}

const LogoSVG = () => (
  <svg xmlns="http://www.w3.org/2000/svg" width="32" zoomAndPan="magnify" viewBox="0 0 282 272.999983" height="32" preserveAspectRatio="xMidYMid meet" version="1.2">
    <g id="ee9afb7799">
      <g mask="url(#94a1c39963)" transform="matrix(0.361816,0,0,0.361816,-45.500761,-50.235679)">
        <image
          xlink:href="data:image/png;base64,"
          height="1024"
          width="1024"
          preserveAspectRatio="xMidYMid meet"
        />
        <mask id="94a1c39963">
          <g transform="matrix(1,0,0,1,-0.000000000000014211,-0.000000000000028422)">
            <image 
              width="1024"
              xlink:href="data:image/png;base64,"
              height="1024"
              preserveAspectRatio="xMidYMid meet"
            />
          </g>
        </mask>
      </g>
    </g>
  </svg>
);

export function FloatingActionButton({ isVisible, isModelLoading, isReady, onClick }: FloatingActionButtonProps) {
  const buttonClasses = [
    classNames.floatingButton,
    isReady && !isVisible ? classNames.floatingButtonReady : null
  ].filter(Boolean).join(' ');

  return (
    <div className={classNames.floatingButtonContainer}>
      {/* Speech bubble when popup is minimized and ready */}
      {!isVisible && isReady && !isModelLoading && (
        <div className={classNames.speechBubble}>
          <div className={classNames.speechBubbleContent}>
            Ready to help!
          </div>
          <div className={classNames.speechBubbleArrow}></div>
        </div>
      )}
      
      <button
        onClick={onClick}
        disabled={isModelLoading}
        className={buttonClasses}
        title={isModelLoading ? "Loading model..." : (isVisible ? "Close Agentary" : "Open Agentary")}
      >
        {isModelLoading ? (
          <i className={`fas fa-spinner ${classNames.spinner}`}></i>
        ) : isVisible ? (
          <i className="fas fa-times"></i>
        ) : (
          <LogoSVG />
        )}
      </button>
    </div>
  );
} 